【デオシート しっかり超吸収 無香消臭タイプ ワイドの詳細】<br>
●スポット吸収でオシッコを小さく閉じ込めるので、広がらないから端でも安心。<br>
●長時間使用出来るので１日に何度も取り換えなくて済み、ゴミの量も軽減し経済的。<br>
●シートサイズ：60×44cm（外寸）<br>
●レギュラーサイズの約２倍の大きさ、新聞紙大の安心サイズ。<br>
●小型犬のオシッコ5-3回分（約150cc）吸収。<br><br>

